SELECT c.CustomerId, p.PaymentId, pd.PaymentDetailsId, c.FirstName,c.LastName, 
	   pd.BankName,pd.CardNumber,p.OrderId,p.BillingDate
FROM Customer c
JOIN Payment p
ON p.CustomerId = c.CustomerId
JOIN PaymentDetails pd
ON pd.PaymentId = p.PaymentId


