SELECT * FROM CustomerHasAddress

SELECT c.CustomerId, a.AddressID, c.FirstName, c.LastName, c.Gender, a.City, a.State
FROM Customer c
JOIN CustomerHasAddress ca 
ON c.CustomerId = ca.CustomerId
JOIN Address a
ON a.AddressID = ca.AddressId
WHERE c.Gender = 'Male'


