SELECT * FROM SupplierContactHasAddress

SELECT s.ContactFName, a.AddressID, a.City,a.State, s.Email, s.Gender, a.Country
FROM SupplierContact s
JOIN SupplierContactHasAddress sa
ON sa.SupplierContactId = s.SupplierContactId
JOIN Address a
ON a.AddressID = sa.AddressId

USE e_commerce_database

SELECT c.CustomerId, c.FirstName,c.LastName, o.Amount, o.OrderId
FROM Customer c
JOIN Orders o
ON o.CustomerId = c.CustomerId
GROUP BY o.Amount
HAVING o.Amount = max(o.Amount)

SELECT top 5 sum(Amount), c.FirstName, c.LastName
FROM Orders o
INNER JOIN Customer c
ON c.CustomerId = o.CustomerId
GROUP BY c.FirstName, c.LastName
ORDER BY sum(o.Amount) DESC

Select * FROM Customer

Select c.CustomerId, DISTINCT c.FirstName
FROM Customer c

